@PaulVittles @NetZeroUK @Bankfieldbecky @LancasterUni @GreenAllianceUK @exeterepg It is very challenging to do organise a mixed / blended in-person and virtual event. Please be less judgmental or go ahead and organise it! 

Also if the meetings get too big it is difficult to facilitate discussions etc. 

It is easy to criticise. Much harder to do it better!
